import { css } from "@emotion/react";

export const mobileContainerStyles = css`
  width: 100%;
  height: 100vh;

  .inner {
    background-color: #f5f5f5;
    height: 100vh;
    width: 100%;
    max-width: 500px;
    margin: 0 auto;
    position: relative;

    .top_nav {
      height: 50px;
      background-color: #333;
      width: 100%;
      position: absolute;
      left: 0;

      h4 {
        color: #f5f5f5;
      }
    }
  }
`;
